import React from 'react';
import { Leader, LeaderInfo } from './Leader';
import leninPhoto from './assets/img/Lenin.jpg';
import { Route, Routes } from 'react-router-dom';
import { NavBar } from './NavBar';
import { BlockProps } from './Block';

const gensek: BlockProps[] = [
  {
      title: 'adasdasd',
      leaders: {
        namee: 'ленин',
        image: leninPhoto,
        info: ['asdasd'],
        years: '1111'
    }

  }
]

function App() {
    return <>
        <NavBar />
        <Routes>
            <Route path="/" element={<p>a</p>} />
            <Route path="/tsars" element={<p>b</p>} />
            <Route path="/gensek" element={<p>c</p>} />
            <Route path="/imperors" element={<p>d</p>} />
        </Routes>
    </>
}

export default App;
